import React, { Component } from 'react';
import './Container.css';
import MyList from './MyList.js';
import Selector from './Selector';

class Container extends React.Component {
    constructor(props) {
        super(props);

        console.log(props)

        this.state = {
            myName: "Bob"
        };
    }

    update = () => {
        this.setState();
    }

    render() {
        return (
            <div>
            <h1>Hello {this.state.myName}</h1>
            <h2>These are your favorite numbers: {this.state.myList}</h2>

            <MyList />

            <input type="submit" onClick={this.update.bind} />
            </div>
        )
    }
}

export default Container
